import React from "react";
import { useEffect } from "react";

const About = (props) => {
  useEffect(() => {
    console.log("hii I am called again");
  }, [prevProps]);

  const Name = () => {
    return <h1> Hello, I am a Name Page </h1>;
  };

  console.log("hii I am called again");

  return <h1> Hello, I am a {props.name} Page </h1>;
};

export default About;
